import { useState, memo } from "react";
function Memo() {
    const [count, setCount] = useState(60);
    const handleClick = () => {
        setCount(count - 1);
    }
    return (
        <>
            <p>{count}</p>
            <button onClick={handleClick}>Click me!</button>
        </>
    )
}
export default Memo;
